import React, { Component } from 'react';
import './App.css';
import Sky from 'react-sky';
import banana from './Components/Pics/banana.png';
import duck from './Components/Pics/duck.png';
import star from './Components/Pics/star.png';
import mouse from './Components/Pics/mouse.png';
import Navigation from './Components/Navigation/Navigation';
import Logo from './Components/Logo/Logo';
import ImageLinkForm from './Components/ImageLinkForm/ImageLinkForm';
import Rank from './Components/Rank/Rank';

const skyParam={
    /* FORMAT AS FOLLOWS */
    0: banana,
    1: duck,
    2: star,
    3: mouse,
};

class App extends Component {
  constructor(){
    super();
    this.state={
      input:'',
    }
  }
  onInputChange = (event) => {
     console.log(event.target.value);
  }
  onButtonSubmit = () => {
    console.log('click');
  }

  render(){
    return (
      <div className="App">
        <Sky
          images={skyParam}
          how={150} /* Pass the number of images Sky will render chosing randomly */
          time={10} /* time of animation */
          size={'100px'} /* size of the rendered images */
          background={'palettedvioletred'} /* color of background */
        />
        <Navigation />
        <Logo />
        <Rank />
        <button 
            className='w-30 grow f4 link ph3 pv2 dib white bg-light-red' 
            onClick={this.onButtonSubmit}>hhahahahaha</button>
        <ImageLinkForm  
          onInputChange={this.onInputChange}
          onButtonSubmit={this.onButtonSubmit}
        />
        {/* <FaceRecognition /> */}
      </div>
     );
  }
}
export default App;
